import React from 'react';
import { View, Text, TouchableOpacity, StyleSheet } from 'react-native';

const Auctions = () => {
    return (
        <View style={styles.container}>
            {/* Titel */}
            <Text style={styles.title}>Auktionen</Text>

            {/* Leiste mit Buttons und Information */}
            <View style={styles.topBar}>
                <View style={styles.buttonsContainer}>
                    {["Allgemein", "Bieten", "Kaufaufträge", "Exponate", "Anforderungen"].map((button, index) => (
                        <TouchableOpacity key={index} style={styles.button}>
                            <Text style={styles.buttonText}>{button}</Text>
                        </TouchableOpacity>
                    ))}
                </View>
                <View style={styles.infoContainer}>
                    <Text style={styles.infoText}>Information</Text>
                </View>
            </View>

            {/* Hauptbereich */}
            <View style={styles.mainContent}>
                {/* Hier kann der Inhalt hinzugefügt werden */}
            </View>
        </View>
    );
};

const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#fff',
        padding: 20,
    },
    title: {
        color: 'rgba(240,175,77,1)',
        fontWeight: 'bold',
        fontSize: 50,
        marginBottom: 20,
        textAlign: 'center',
    },
    topBar: {
        flexDirection: 'row',
        marginBottom: 20,
    },
    buttonsContainer: {
        flexDirection: 'row',
        flex: 3,
        backgroundColor: 'rgb(247,203,105)',
        paddingVertical: 10,
        paddingHorizontal: 5,
    },
    button: {
        flex: 1,
        justifyContent: 'center',
        alignItems: 'center',
        marginHorizontal: 5,
    },
    buttonText: {
        fontWeight: 'bold',
        color: 'black',
    },
    infoContainer: {
        flex: 1,
        backgroundColor: 'rgb(247,203,105)',
        justifyContent: 'center',
        alignItems: 'center',
        padding: 10,
    },
    infoText: {
        fontWeight: 'bold',
        color: 'black',
        textAlign: 'center',
    },
    mainContent: {
        flex: 1,
        backgroundColor: 'rgb(245,200,90)',
        borderTopWidth: 1,
        borderTopColor: 'rgb(247,203,105)',
    },
});

export default Auctions;
